// html spaghetti code
document.getElementById('plus').onclick = () => {
    if (mintAmount < 5) {
        mintAmount++;
        document.getElementById('amount').src = `images/${mintAmount}.png`;
    }
};
document.getElementById('minus').onclick = () => {
    if (mintAmount > 1) {
        mintAmount--;
        document.getElementById('amount').src = `images/${mintAmount}.png`;
    }
};
$(document).ready(function () {
    var pause = false;
    var interval = window.setInterval(function () {
        if (!pause) {
            $('.borb').css('background-image', "url('images/background3.jpg')");
            window.setTimeout(function () {
                $('.borb').css('background-image', "url('images/background.jpg')");
            }, 200);
            window.setTimeout(function () {
                $('.borb').css('background-image', "url('images/background3.jpg')");
            }, 500);
            window.setTimeout(function () {
                $('.borb').css('background-image', "url('images/background.jpg')");
            }, 700);
        }
    }, 14000);

    $("#mint").hover(function () {
        pause = true;
        $('.borb').css('background-image', "url('images/background2.jpg')");
    }, function () {
        pause = false;
        $('.borb').css('background-image', "url('images/background.jpg')");
    });
})

document.getElementById('enter').onclick = () => {
    var music = document.getElementById('music');
    music.volume = 0.08;
    music.play();
    document.getElementById('page1').style.display = 'none';
    document.getElementById('page2').style.display = 'block';
};

document.getElementById('mute').onclick = () => {
    var music = document.getElementById('music');
    if (music.paused) {
        music.play();
        document.getElementById('mute').src="images/sound_on.png";
    } else {
        music.pause();
        document.getElementById('mute').src="images/sound_off.png";
    }
};

